export const props = [
  {
    param: 'spin',
    desc: '是否有旋转动画',
    type: 'Boolean',
    require: '否',
    default: 'false',
  },
  {
    param: 'color',
    desc: '自定义默认图片的颜色',
    type: 'String',
    require: '否',
    default: '#333',
  },
  {
    param: 'className',
    desc: '自定义组件最外层的 class 名字',
    type: 'String | Object | Array',
    require: '否',
    default: '无',
  },
];

export const methods = [];
